    return (

        <List className = "todo__list">
            <ListItem>
                <ListItemAvatar>
                    <Avatar>

                    </Avatar>
                </ListItemAvatar>
                 <ListItemText primary="TODO" secondary = {props.text} />
            </ListItem>
        </List>


       /* <div>
            <li>{props.text}</li>
        </div>

        /}
        */
    )
}

export default Todo
